import React from "react";

const Speakers = () => {
  const speakers = [
    { imageSrc: "images/speaker-component-1124", name: "Douglas CorckFord" },
    { imageSrc: "images/speaker-component-1530", name: "Tamara Baker" },
    { imageSrc: "images/speaker-component-10803", name: "Eugene Chuvyrov" },
  ];
  return (
    <div>
      <img src="images/speaker-component-1124.png" />
      <img src="images/speaker-component-1530.png" />
      <img src="images/speaker-component-10803.png" />
    </div>
  );
};

export default Speakers;
